import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Ourbenefits from './components/Ourbenefits';
import Rentalworks from './components/Rentalworks';

function App() {
  return (
    <main>
      <Ourbenefits />
      <Rentalworks />
    </main>
  );
}

export default App;
